import React from "react";
import NavItem from "./nav-item/Nav-item.component";
import "./Navbar.styles.scss";
const Navbar = () => {
  const navItems = [["Home", ""], ["Resume",""], ["Portfolio", ['Graphic Design','Drawing', 'Painting', 'Photography']], ["Contact",''], ["Shop",'']];
  return (
    // <div className = 'nav-bar' style = {{display:'flex', justifyContent: 'space-evenly', backgroundColor:'#563d7c'}}>
    //     {navItems.map(ele=><NavItem item = {ele}/>)}

    // </div>
    <div >
      <nav class="navbar navbar-expand-lg" style={{backgroundColor:'#563d7c'}} >

        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
          {navItems.map(ele=><NavItem item = {ele[0]} dropDownItems={ele[1]}/>)}


          </ul>

        </div>
      </nav>
    </div>
  );
};

export default Navbar;
